// Extract and parse the nested JSON
const rawResponse = $input.first().json;
const textContent = rawResponse.result.content[0].text;
const parsedData = JSON.parse(textContent);

// Extract key financial data for emergency fund calculation
const netWorthData = parsedData.netWorthResponse || {};

// Get asset and liability arrays safely
const assetValues = netWorthData.assetValues || [];
const liabilityValues = netWorthData.liabilityValues || [];

// Get liquid assets (savings accounts primarily)
const savingsAccount = assetValues.find(
  asset => asset.netWorthAttribute === "ASSET_TYPE_SAVINGS_ACCOUNTS"
);

// Calculate total liquid assets
const liquidAssets = parseInt(savingsAccount?.value?.units || "0");

// Calculate total Assets
const totalAssets = assetValues.reduce((sum, assets) => {
  return sum + parseInt(assets.value.units);
}, 0);

// Calculate total liabilities
const totalLiabilities = liabilityValues.reduce((sum, liability) => {
  return sum + parseInt(liability.value.units);
}, 0);

// Clean output structure
return {
  json: {
    liquidAssets: liquidAssets,
    totalAssets: totalAssets,
    totalLiabilities: totalLiabilities,
    totalNetWorth: parseInt(netWorthData.totalNetWorthValue?.units || "0"),
    rawAssets: assetValues,
    rawLiabilities: liabilityValues
  }
};

// Clean bank transactions - parse JSON-RPC response
const rawResponse = $input.all()[0].json;

// Extract the actual transaction data from JSON-RPC wrapper
const transactionText = rawResponse.result?.content?.[0]?.text;
const rawData = transactionText ? JSON.parse(transactionText) : {};
console.log(JSON.stringify(rawData.bankTransactions, null, 2));



// Safe access to bankTransactions
const bankTransactions = rawData.bankTransactions || [];

let allTransactions = [];

bankTransactions.forEach(account => {
  if (Array.isArray(account.txns)) {
    account.txns.forEach(txn => {
      allTransactions.push({
        amount: parseFloat(txn[0]),
        narration: txn[1],
        date: txn[2],
        type: txn[3], // 1=CREDIT, 2=DEBIT
        mode: txn[4],
        balance: parseFloat(txn[5])
      });
    });
  }
});

// Basic categorization
const debitTransactions = allTransactions.filter(txn => txn.type === 2);
const creditTransactions = allTransactions.filter(txn => txn.type === 1);

// Simple totals and averages (avoid division by 0)
const totalDebits = debitTransactions.reduce((sum, txn) => sum + txn.amount, 0);
const totalCredits = creditTransactions.reduce((sum, txn) => sum + txn.amount, 0);

return [{
  json: {
    transactionPeriod: "2 months",
    totalTransactions: allTransactions.length,
    debitTransactions: debitTransactions,
    creditTransactions: creditTransactions,
    summary: {
      totalDebits: totalDebits,
      totalCredits: totalCredits,
      monthlyAverageDebits: totalDebits / 2,
      monthlyAverageCredits: totalCredits / 2
    }
  }
}];

// Extract and parse the raw JSON-RPC payload
const raw = $input.first().json;
const text = raw.result?.content?.[0]?.text || '{}';
let parsed;

try {
  parsed = JSON.parse(text);
} catch (e) {
  throw new Error("Invalid JSON in stock transaction text.");
}

const txns = parsed.stockTransactions || [];

const TRANSACTION_TYPES = {
  1: "BUY",
  2: "SELL",
  3: "BONUS",
  4: "SPLIT"
};

let cleaned = [];

txns.forEach(stock => {
  const isin = stock.isin;
  const transactions = stock.txns || [];

  transactions.forEach(txn => {
    cleaned.push({
      json: {
        isin,
        type: TRANSACTION_TYPES[txn[0]] || "UNKNOWN",
        date: txn[1],
        quantity: txn[2],
        nav: txn[3] !== undefined ? parseFloat(txn[3]) : null
      }
    });
  });
});

return cleaned;

